import React from 'react';
import './Node.css';

const Node = ({ id, cx, cy }) => {
	// add the 'px' and convert cx, cy to strings
	var cx_str = cx + 'px';
	var cy_str = cy + 'px';
	console.log(cx);

	// overwrite width, height and border-radius styles
	var circStyles = {
		margin: cx_str,
    	width: '100px',
    	height: '100px',
		borderRadius: '50px',
		background: 'grey',
	};


	return (
		<div style = {circStyles}>			
		</div>
	);
}

export default Node;
